import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Check if cart has items
    const emptyCart = await page.$('.empty-cart');
    if (emptyCart) {
      throw new Error('Cart is empty - cannot update quantity');
    }

    // Get initial quantity of first item
    const initialQuantity = await page.textContent('.cart-item:first-child .quantity');

    // Increase quantity by clicking plus button
    await page.waitForSelector('.cart-item:first-child .quantity-btn >> text=+', { timeout: 5000 });
    await page.click('.cart-item:first-child .quantity-btn >> text=+');

    // Wait for quantity to update
    await page.waitForFunction(
      (initialQty) => {
        const currentQty = document.querySelector('.cart-item:first-child .quantity').textContent;
        return parseInt(currentQty) === parseInt(initialQty) + 1;
      },
      initialQuantity,
      { timeout: 5000 }
    );

    // Get updated quantity
    const updatedQuantity = await page.textContent('.cart-item:first-child .quantity');
    const productTitle = await page.textContent('.cart-item:first-child .cart-item-title');

    // Take screenshot of updated cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    return {
      success: true,
      action: "Updated cart item quantity from " + initialQuantity + " to " + updatedQuantity,
      extractedData: {
        productTitle: productTitle.trim(),
        initialQuantity: parseInt(initialQuantity),
        updatedQuantity: parseInt(updatedQuantity)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
